package com.jsp.footmap.model;public class Email {    private int eid;    private String inputEmail;    private int code;    private int uid;    public int getEid() {        return eid;    }    public void setEid(int eid) {        this.eid = eid;    }    public String getInputEmail() {        return inputEmail;    }    public void setInputEmail(String inputEmail) {        this.inputEmail = inputEmail;    }    public int getCode() {        return code;    }    public void setCode(int code) {        this.code = code;    }    public int getUid() {        return uid;    }    public void setUid(int uid) {        this.uid = uid;    }}